import React, { useState } from 'react';
import MemberForm from './components/Form'
import { Header, Segment, Container } from 'semantic-ui-react'
import './App.css';

function App() {

  const [teamList, setTeamList] = useState([])


  return (
    <Container className="App">
      <MemberForm />
      <div className='team-list'>
      <Header>Team Member List</Header>
      <Container className='member-grid'>
        <Container className='team-member'>
          <Header>{MemberForm.member.name}</Header>
          <Segment>Email: {MemberForm.member.email}</Segment>
          <Segment>Role: {MemberForm.member.role}</Segment>
        </Container>
      </Container>
      </div>
    </Container>
  );
}

export default App;
